{"id": 105, "url": "https://www.apartmentfinder.com/California/San-Diego-Apartments/Regents-Court-Apartments", "title": "Regents Court Apartments", "location": "8465 Regents Rd, San Diego, CA  92122", "rent_special": "", "price_range": "$1,939 - $9,010", "beds": "1 - 3", "bath": "1 - 3", "lease_term": "None", "assigned_garage_parking_price": "", "assigned_other_parking_price": "", "cat_rent": "$40", "dog_rent": "$50", "application_fee": "$45", "cat_deposit": "$350", "dog_deposit": "$500", "apartment_description": "In light of COVID-19, we are committed to maintaining the well-being of our residents and associates. We have several different tour options available for you! We are conducting virtual tours, self-guided tours, and in-person tours by appointment. We are open daily to assist you with all of your leasing and residential needs. We appreciate your understanding as we learn to navigate through this time together and look forward to hearing from you soon. \n\n*We have homes available for move in today!\n*Restrictions apply. Subject to change at any time. Please call for details.\n\nNow accepting dogs up to 100lbs! *Breed restrictions apply\n\nCall us at (855) 433-1989 or email at regentscourt@greystar.com to find the perfect home for you!\n\nYour search for the very best in apartment living in San Diego, CA has just come to an end! At Regents Court you can settle into a comfortable lifestyle that combines the aesthetics of a perfectly located luxury apartment home with an inspiring backdrop of exceptional amenities. Situated in the La Jolla Triangle, our ideal location allows easy access to I-5, I-805, UC San Diego, shopping and fine restaurants. Regents Court is also just minutes from La Jolla Shores, Mission Bay beaches and the Pacific coastline. Choose from a variety of award-winning one, two, and three bedroom floor plans designed with amenities that assure the quality and comfort you deserve! Imagine a spacious apartment home with designer features such as granite countertops, ceramic tile entries, washers and dryers, lofty nine-foot ceilings, private balconies or patios and walk-in closets. Designer gourmet kitchens have stainless steel appliances, granite countertops, built-in microwaves, frost-free refrigerators with icemakers, garbage disposals and seven cycle dishwashers. Entertainment at Regents Court is endless, whether you are looking for an indoor or outdoor activity. Enjoy two Jacuzzi spas, heated swimming pool, resident lounge, clubhouse and business center with conference room, flex room, game room, and a 24 hour state-of-the-art fitness center. We take pride in delivering exemplary service in a quality home environment and our community is managed by professionals dedicated to enhancing your lifestyle. Take a tour through our website and don\u2019t forget to visit our photo gallery and see why Regents Court is San Diego\u2019s best kept secret!", "office_hour": {"Monday": {"time_open": "9AM", "time_close": "6PM"}, "Tuesday": {"time_open": "11AM", "time_close": "6PM"}, "Wednesday": {"time_open": "9AM", "time_close": "6PM"}, "Thursday": {"time_open": "11AM", "time_close": "6PM"}, "Friday": {"time_open": "9AM", "time_close": "6PM"}, "Saturday": {"time_open": "9AM", "time_close": "6PM"}, "Sunday": {"time_open": "10AM", "time_close": "5PM"}}, "special_features": ["1, 2 and 3 Bedroom Apartments For Rent", "Air Conditioner", "BBQ/Picnic Area", "Bike Racks", "Cable Ready", "Carpeting", "Ceiling Fan", "Courtesy Patrol", "Courtyard", "Dishwasher", "Disposal", "Extra Storage", "Fiber Ready", "Heated Swimming Pool", "High Speed Internet Access", "Large Closets", "Microwave", "Off Street Parking", "Patio/Balcony", "Recycling", "Refrigerator", "View", "Washer/Dryer", "Wheelchair Access", "Window Coverings"], "community_features": ["Laundry Facilities", "Maintenance on site", "Elevator", "Business Center", "Clubhouse", "Fitness Center", "Spa", "Pool"], "floorplan_amenities": ["High Speed Internet Access", "Washer/Dryer