{"id": 129, "url": "https://www.apartmentfinder.com/California/San-Diego-Apartments/The-Missions-At-Rio-Vista-Apartments", "title": "The Missions at Rio Vista Apartments", "location": "2242-2282 Gill Village Way, San Diego, CA  92108", "rent_special": "", "price_range": "$1,860 - $3,030", "beds": "1 - 3", "bath": "1 - 2", "lease_term": "12", "assigned_garage_parking_price": "", "assigned_other_parking_price": "", "cat_rent": "$50", "dog_rent": "$50", "application_fee": "$25", "cat_deposit": "$500", "dog_deposit": "$500", "apartment_description": "Welcome home to The Missions at Rio Vista in sunny San Diego, California. You will find our beautiful community centrally located just minutes away from the major freeways, and walking distance to shopping centers, movie theaters, and restaurants. We are an easy commute to major universities such as: SDSU, USD, AI and UCSD. Whether it is going Downtown, relaxing at one of the sunny beaches in San Diego, taking a trolley ride to Old Town or strolling along the San Diego River, you will always be close to home!The Missions at Rio Vista offers one, two, and three bedroom floor plans that were designed to best fit your needs. Our homes have an all-electric gourmet kitchen complete with a breakfast bar, and spectacular views from your own private balcony/patio. Our homes feature plush wall-to-wall carpeting, nine foot ceilings, crown molding, full-size washers/dryers, large walk-in closets, intrusion alarms, and central air conditioning/heating. The Missions at Rio Vista offers many community amenities for our residents to enjoy such as, our lagoon style pool, lap pool, 24 hour state-of-the-art fitness center, and business center with high-speed internet. Our efficient on-site management team is available to help make life simple with package acceptance, online payment and service request options, and many additional resident services. If you are looking for a pet friendly community in Mission Valley, look no further! The Missio