{"id": 418, "url": "https://www.apartmentfinder.com/California/Chula-Vista-Apartments/Costa-Fina-Apartments", "title": "Costa Fina Apartments", "location": "1271 Broadway, Chula Vista, CA  91911", "rent_special": "", "price_range": "$1,425 - $1,595", "beds": "1 - 2", "bath": "1", "lease_term": "6 months", "assigned_garage_parking_price": "", "assigned_other_parking_price": "", "cat_rent": "", "dog_rent": "", "application_fee": "$45", "cat_deposit": "", "dog_deposit": "", "apartment_description": "This apartment community offers features like: full time manager and leasing office, spacious laundry facility, off street assigned parking, online payments, gated entrance/exit, and pool area. Costa Fina Apartments is also near restaurants, shopping centers, major freeways, schools, and public transportation. If you are interested apply online today at www.costafinacommunity.com\n\n*We are smoke free community\n*No pets accepted\n\nRental Criteria:\nI.\tGeneral Requirements\n\nA completed and signed application for every applicant 18 years or older.  Emancipated minors must show written legal proof. \n\nApplication fee of $45 per applicant (non-refundable), must be paid by money order, cashier\u2019s check, or submitted online in order to process application.\n\nII.\tIdentification\n\nWe require a current/valid government issued photo ID for all occupants 18 years of age or older (i.e. state IDs, government IDs, passport/visa, or driver\u2019s license).\n\nIII.\tIncome\n\nProof of income is required and needs to be verifiable.  We need two current pay stubs if paid bi weekly and 4 pay stubs if paid weekly, if you are an independent contractor we need your most recent tax-returns, bank statements, employment contracts, business license, are required to verify income.  Applicants will be denied if source of income cannot be verified.  \n\nFor other income, we need proof whether it is retirement income, unemployment letter, government payment, or rental assistance.\n\nApplicants must make 2.5 times the rent amount to qualify.\n\nIV.\tRental History\n\nApplicant must have satisfactory rental history and no eviction or rental defaults.  If an applicant has been evicted or has any defaults, the application will be denied.  Applicant must be in good standing with previous property management company/owner in order to rent with Walz Properties. \n\nApplicants with no rental history may result in an increase of security deposit once credit check is run and is satisfactory according to our rental criteria. \n\nV.\tCredit History\n\nApplicants must have a satisfactory credit report.  No credit reported by the credit bureau is interpreted as good credit.  Discharged bankruptcies over a year are accepted, less than a year from date of application will be denied.  If applicant is denied due to an unsatisfactory report, a letter will be given to applicant explaining the reason of denial, credit bureau provider and information. \n\nAn incomplete application, inaccurate, or falsified information will result in a denial.\n\nWalz Properties evaluates the information provided by running a credit report, which verifies rental history and employment.  We use a scoring method by reviewing collections, bad debt, unsatisfactory judgments, evictions, rental defaults, or undischarged bankruptcies.", "office_hour": {"Monday": {"time_open": "8:30AM", "time_close": "3PM"}, "Tuesday": {"time_open": "8:30AM", "time_close": "3PM"}, "Wednesday": {"time_open": "8:30AM", "time_close": "3PM"}, "Thursday": {"time_open": "8:30AM", "time_close": "3PM"}, "Friday": {"time_open": "8:30AM", "time_close": "3PM"}, "Saturday": {"time_open": "By Appointment", "time_close": ""}, "Sunday": {"time_open": "By Appointment", "time_close": ""}}, "special_features": [], "community_features": ["Laundry Facilities", "Clubhouse", "Pool", "Playground"], "floorplan_amenities": ["High Speed Internet Access", "Heating", "Smoke Free", "Cable Ready", "Disposal", "Kitchen", "Refrigerator"], "parkin